import { Divider, Heading, VStack } from "@chakra-ui/react";
import React from "react";

const RandomRecipe = () => {
  return (
    <>
      <VStack mt={20} h="full">
        <Heading>Recipe:</Heading>
        <Divider />
        <Box></Box>
      </VStack>
    </>
  );
};

export default RandomRecipe;
